select a.id ,c.nombre as carpeta ,a.nombre ,a.tipo ,a.tamaño, a.descripcion ,a.created_at 
					<strong>FROM</strong> archivos a 
					<strong>INNER</strong> <strong>JOIN</strong> carpetas c  <strong>ON</strong> a.carpeta  = c.id where a.carpeta =&#039;1&#039;;

